  "source": "pragma solidity 0.4.24;\n\nimport { Core } from \"../../core/Core.sol\";\nimport { ISetToken } from \"../../core/interfaces/ISetToken.sol\";\n\n// Mock contract implementation of Core with extra functions for testing\ncontract CoreMock is Core {\n    constructor(\n        address _transferProxy,\n        address _vault\n    )\n        public\n        Core(_transferProxy, _vault)\n    {}\n\n    /*\n     * Mint set token for given address.\n     * Can only be called by authorized contracts.\n     *\n     * @param  _set         The address of the Set to mint\n     * @param  _issuer      The address of the issuing account\n     * @param  _quantity    The number of sets to attribute to issuer\n     */\n    function mint(\n        address _set,\n        address _issuer,\n        uint256 _quantity\n    )\n        external\n    {\n        ISetToken setToken = ISetToken(_set);\n\n        // Issue set token\n        setToken.mint(\n            _issuer,\n            _quantity\n        );\n    }\n\n    /*\n     * Burn set token for given address.\n     * Can only be called by authorized contracts.\n     *\n     * @param  _set         The address of the Set to burn\n     * @param  _from        The address of the redeeming account\n     * @param  _quantity    The number of sets to burn from redeemer\n     */\n    function burn(\n        address _set,\n        address _from,\n        uint256 _quantity\n    )\n        external\n    {\n        ISetToken setToken = ISetToken(_set);\n\n        // Issue set token\n        setToken.burn(\n            _from,\n            _quantity\n        );\n    }\n}\n\n",
